webpackJsonp([79682584718802],{393:function(e,t){e.exports={data:{site:{siteMetadata:{title:"keto.nyc",author:"Una Kravets"}},markdownRemark:{id:"/Users/unakravets/Dev/keto.nyc/src/pages/2018-08-06-double-chocolate-strawberry-cake/index.md absPath of file >>> MarkdownRemark",html:'<h2>You’ll Need:</h2>\n<h3>For the Dough:</h3>\n<ul>\n<li>1/2 cup coconut flour</li>\n<li>1/2 cup cocoa powder</li>\n<li>1/2 tsp baking soda</li>\n<li>1 tsp baking powder</li>\n<li>1 cup <a href="https://amzn.to/2OwdAZD">powdered erythritol</a></li>\n<li>6 large eggs</li>\n<li>6 tbsp coconut oil, melted</li>\n<li>6 tbsp coconut milk</li>\n<li>8 Large Strawberries</li>\n</ul>\n<h3>For the Icing:</h3>\n<ul>\n<li>1 cup coconut milk (full fat)</li>\n<li>1 1/4 cups <a href="https://amzn.to/2nuCwVW">Lily’s chocolate chips</a></li>\n<li>1/4 cup powdered erythritol</li>\n</ul>\n<h2>Directions:</h2>\n<ol>\n<li>Preheat the oven to 350 degrees Fahrenheit. Line and grease <em>two</em> 8 x 8-inch square pans and set aside. </li>\n<li>In a high-speed blender or food processor, combine all your ingredients and blend until a thick batter remains. Ensure you regularly scrape down the sides to ensure all the ingredients are fully incorporated. <em>Add baking powder last</em></li>\n<li>Pour half of the batter into each lined pan and bake for 30-35 minutes, or until a skewer comes out the center.</li>\n<li>Once cool, mix coconut milk, erythritol, and chocolate chips together to make the frosting. Refrigerate to firm up slightly.</li>\n<li>Once more firm, apply a thick layer frosting on top of one of your cakes sheets. Stack the other sheet of cake on top.</li>\n<li>Continue to heavily frost all over the cake and top with sliced strawberries.</li>\n</ol>\n<p><small>* Adopted from <a href="https://thebigmansworld.com/2018/06/21/flourless-paleo-vegan-chocolate-cake-keto-low-carb/">The Big Man’s World Recipe</a></small></p>',frontmatter:{date:"August 06, 2018",protein:10,funFact:"Made for Ben's 26th birthday!",servings:16,netCarbs:2,calories:278,fat:0,carbs:10,title:"Double Chocolate Keto Cake",fiber:8,sugars:null,prepTime:"5 minutes",cookTime:"30 minutes",readyTime:"1 hour",image1:{childImageSharp:{resolutions:{width:800,height:800,src:"/static/cover-c35ba0dc39bb36d415e62e7417b81dab-4042a.jpg",srcSet:"/static/cover-c35ba0dc39bb36d415e62e7417b81dab-4042a.jpg 1x"}}},image2:{childImageSharp:{resolutions:{width:800,height:534,src:"/static/secondary-5110a985dcfd3db8d896ea6d7ce43cb3-4042a.jpg",srcSet:"/static/secondary-5110a985dcfd3db8d896ea6d7ce43cb3-4042a.jpg 1x"}}}}}},pathContext:{slug:"/2018-08-06-double-chocolate-strawberry-cake/",previous:{fields:{slug:"/2018-07-29-soyrizo-scramble/"},frontmatter:{title:"Soyrizo Scramble"}},next:{fields:{slug:"/2018-08-23-pb-magic-mug-cake/"},frontmatter:{title:"Peanut Butter Protein Magic Mug Cake"}}}}}});
